import React, { useState } from 'react';

const App = () => {

    const [newData, setNewData] = useState('');

    const inputEvent = (event) => {
        let data = event.target;
        console.log(data);
    }
    // const Submit = () => {
    //     setNewData(data);
    // }

    return (
        <>
                <div className='main_div'>
                    <h1>ToDo List</h1>
                    <input type='text' placeholder='Add The Items' name='data' onChange={inputEvent} value={newData.data}></input>
                    <button >+</button>
                    <br />
                    <p>{newData.data}</p>
                </div>
        </>
    )

}

export default App;
